long_desc.thetext:
I want to control inverse end of bidirectional many-to-many association using jpa annotation in my model. 

I have class Placement with Elist info and class Placement with EList describes.
Placement.info and PlacementInfo.describes are many-to-many association.

I have annotated PlacementInfo.describes with 
@ManyToMany(indexed="false" mappedBy="info")

of course with source="teneo.jpa"

But in hibernate mapping generated by teneo I see both Placement.info and PlacementInfo.describes with inverse="true".

I looked into teneo code and understood why it happens:

1) In DefaultAnnotator:
if (mtm.getMappedBy() == null && setMappedBy(eReference)) {
	mtm.setMappedBy(eOpposite.getName());
}

2) what is returned by setMappedBy(eReference)?
private boolean setMappedBy(EReference eReference) {
		// only set in two way relation
		// if has not been set on the other side (mappedtoFields)
		// if not a containment relation, containment relations are handled differently
		// the other side may neither be containment
		final EReference eOpposite = eReference.getEOpposite();
		if (eOpposite == null)
			return false;
		return compareNames(eReference, eOpposite);

	}

3) what happens in compareNames()?

private boolean compareNames(EReference here, EReference there) {
		final String nameHere = here.eClass().getName() + here.getName();
		final String nameThere = there.eClass().getName() + there.getName();
		assert (nameHere.compareTo(nameThere) != 0);
		return nameHere.compareTo(nameThere) > 0;
	}

So when Placement.info was proceeded it had mtm.mappedBy=null. But cause EReferenceinfo > EReferencedescribes mtm.mappedBy for Placement.info became "describes".

Finally how hib mapping is done?
ManyToManyMapper has following lines in process(PAnnotatedEReference paReference)method:

if (mtm.getMappedBy() != null && !mtm.isIndexed()) {
	collElement.addAttribute("inverse", "true");
}

So for PlacementInfo mtm.getMappedBy() != null and I have inverse="true" for both ends of many-to-many association.

I suppose it's not hard to fix - I have shown root of problem in code :)

Thanks

Hi Ilya,
Thanks for the research of finding the cause for the issue.
As you point out this occurs if manytomany was already set manually on one of the two sides.
I have committed a fix. I am not sure if you can try it out?
This is a summary of the change:

In DefaultAnnotator I have changed this:
if (mtm.getMappedBy() == null && setMappedBy(eReference)) {
        mtm.setMappedBy(eOpposite.getName());
}

to this:
		final PAnnotatedEReference otherPA = aReference.getPaModel().getPAnnotated(eOpposite);
		if (mtm.getMappedBy() == null && setMappedBy(eReference) 
				&& (otherPA.getManyToMany() == null || otherPA.getManyToMany().getMappedBy() == null)) {
			mtm.setMappedBy(eOpposite.getName());
		}

