Creating text widget and focusing on it in same action causes it to show up blank initially.
Below is the code to make it happen. Only appears to happen on mac.
If you change the worksProperly flag to true, you'll see what it's supposed to do.




import org.eclipse.swt.SWT;
import org.eclipse.swt.layout.RowLayout;
import org.eclipse.swt.widgets.Button;
import org.eclipse.swt.widgets.Display;
import org.eclipse.swt.widgets.Event;
import org.eclipse.swt.widgets.Listener;
import org.eclipse.swt.widgets.Shell;
import org.eclipse.swt.widgets.Text;

public class FocusTest {
	public static void main(String[] args) {
		final boolean worksProperly = false;

		final Display d = new Display();
		final Shell s = new Shell(d);
		s.setLayout(new RowLayout());

		Button b = new Button(s, SWT.PUSH);
		b.setText("Push Me");
		b.addListener(SWT.MouseUp, new Listener() {

			public void handleEvent(Event arg0) {
				final Text txt = new Text(s, SWT.BEGINNING | SWT.BORDER);
				txt.setText("FOOBAR");
				if (!worksProperly)
					txt.forceFocus();

				s.pack();
				if (worksProperly)
					d.asyncExec(new Runnable() {
						public void run() {
							txt.forceFocus();
						}
					});
			}

		});

		s.pack();
		s.open();

		while (!s.isDisposed())
			if (!d.readAndDispatch())
				d.sleep();
	}
}

